import "./index.css"

let Home = (props) => {
    return (
        <div className="header">
            <label className="label-header">
                {props.labelHeader}
                <a href="" className="label-goto">
            {props.labelGoto}
            </a>
            </label>
        </div>
    )
}

export default Home;
